        [Fact]
        public void GetAll_StateUnderTest_ExpectedBehavior()
        {
            // Arrange
            var service = this.CreateService();
            service.ObjectMapper = LocalIocManager.Resolve<Abp.ObjectMapping.IObjectMapper>();
            service.UnitOfWorkManager = Resolve<IUnitOfWorkManager>();
            service.UnitOfWorkManager.Begin();

            GetPropertyImagesListInput input1 = new GetPropertyImagesListInput { MaxResultCount = 10, SkipCount = 0, Sorting = "", PropertyId = 1 };
            GetPropertyImagesListInput input2 = new GetPropertyImagesListInput { MaxResultCount = 0, SkipCount = 0, Sorting = "", PropertyId = 1 };
            GetPropertyImagesListInput input3 = new GetPropertyImagesListInput { MaxResultCount = 0, SkipCount = 0, Sorting = "", PropertyId = 999 };


            // Act
            var result1 = service.GetAll(
                input1);
            var result2 = service.GetAll(
                input2);
            var result3 = service.GetAll(
                input3);

            // Assert
            Assert.True(result1.Status == TaskStatus.RanToCompletion && result1.Result.TotalCount > 0);
            Assert.True(result2.Status == TaskStatus.RanToCompletion && result2.Result.TotalCount > 0);
            Assert.True(result3.Status == TaskStatus.RanToCompletion && result3.Result.TotalCount == 0);
        }

